import React, { useEffect, useState } from 'react';
import { fetchUserProfile } from '../../service/api';
import { useAuth } from '../../context/AuthContext';

const Profile = () => {
  const { authTokens } = useAuth();
  const [profile, setProfile] = useState(null);

  useEffect(() => {
    const getUserProfile = async () => {
      try {
        const response = await fetchUserProfile(authTokens);
        setProfile(response.data);
      } catch (err) {
        console.error('Failed to fetch user profile', err);
      }
    };

    getUserProfile();
  }, [authTokens]);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (!profile) return <p>Loading profile... ‚è≥</p>;

  return (
    <div>
      <h1>User Profile üë§

             <div class="relative inline-block">
                <img src="https://readymadeui.com/team-4.webp" class="w-14 h-14 rounded-full border-2 border-blue-600 p-0.5" />
                <span class="h-3 w-3 rounded-full border border-white bg-green-500 block absolute top-1 right-0"></span>
              </div> 
      </h1>
      <p><strong>Username:</strong> {profile.username}</p>
      <p><strong>Email:</strong> {profile.email}</p>

      {/* Add more profile details as needed */}

      <button 
              onClick={handleLogout}
              className="mt-8 bg-red-600 text-white px-6 py-2 rounded hover:bg-red-700 transition duration-300"
            >
              Logout üö™
            </button>
    </div>
  );
};

export default Profile;
